import Navbar from "./Navbar";
import React from "react";
import styles from "../css/Dashboard.module.css";

function Dashboard() {
  return (
    <>
      <Navbar />
      <div className={styles.dashboard_sect}>
        <div className={styles.add_product}>
          <form action="#"></form>
        </div>
      </div>
    </>
  );
}

export default Dashboard;
